import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
} from 'react-router-dom';

class Header extends Main{
  constructor(){
    super();
  }
  render(){
    return(
     <>
      <ul className="nav nav-pills nav-fill main-color display-6">
        <a className="nav-link link-light d-flex align-items-center" href="http://localhost:3000/">TestName</a>
        <nav className="navbar navbar-dark">
          <button className="btn btn-outline-secondary d-flex btn-lg" data-bs-toggle="collapse" data-bs-target="#header-navbar">
          <span className="navbar-toggler-icon"></span>
          </button>
        </nav>
      </ul>
      <div id="header-navbar" className="collapse">
      <ul className="row nav nav-pills nav-fill main-color display-5 header-menu">
        <li className="col-12 col-sm-4 nav-item">
          <p><a className="nav-link link-light h3" href="./profile.html">Личный кабинет</a></p>
        </li>
        <li className="col-12 col-sm-4 nav-item">
          <p><a className="nav-link link-light h3">Мои заказы</a></p>
        </li>
        <li className="col-12 col-sm-4 nav-item">
          <p><a className="nav-link link-light h3">Тех. Поддержка</a></p>
        </li>
      </ul>
      </div>
     </>
    );
  }
}
export default Header;
